#import "DummyView.h"
#import "AlanManager.h"
#import "AlanSDK.h"

@implementation DummyView

- (void)dealloc
{
    AlanButton* alanButton = AlanManager.shared.alanButton;
    if( alanButton != nil )
    {
        [alanButton removeFromSuperview];
        alanButton = nil;
    }
}

@end
